import React from 'react';
import Header from '../components/Header';
import './Home.css';

const Home = () => {
    return (
        <>
            <Header />
            <div className="banner-container">
                <div className="product-scroller">
                    <a href="/products">
                        <img className="product-img" src="/images/product1.jpg" alt="Product 1" />
                    </a>
                    <a href="/products">
                        <img className="product-img" src="/images/product2.jpg" alt="Product 2" />
                    </a>
                    <a href="/products">
                        <img className="product-img" src="/images/product3.jpg" alt="Product 3" />
                    </a>
                </div>
            </div>
        </>
    );
};

export default Home;
